    "src/WonderKey721.sol": {
      "content": "// SPDX-License-Identifier: GPL-3.0-or-later

pragma solidity ^0.8.13;

import {ERC721} from "solmate/tokens/ERC721.sol";
import {LeanOwnable} from "./LeanOwnable.sol";
import {LeanStrings} from "./LeanStrings.sol";

error TokenNotMinted();
error MaxSupplyReached();

contract WonderKey721 is ERC721, LeanOwnable {
    using LeanStrings for uint;

    event ExternalIdMint(bytes12 itemId);

    uint256 public immutable maxSupply;
    uint256 public totalSupply = 0;
    string private _baseURI;

    constructor(string memory name, string memory symbol, string memory baseURI, uint256 _maxSupply) ERC721(name, symbol) {
        require(_maxSupply != 0);
        maxSupply = _maxSupply;
        _baseURI = baseURI;
    }

    function tokenURI(uint256 tokenId) public view override returns (string memory) {
        if (_ownerOf[tokenId] == address(0)) {
            revert TokenNotMinted();
        }
        return bytes(_baseURI).length > 0 ? string(abi.encodePacked(_baseURI, tokenId.toString())) : "";
    }

    function mint(address to, uint256 tokenId, bytes12 externalId) external onlyOwner {
        if (totalSupply + 1 > maxSupply) {
            revert MaxSupplyReached();
        }
        unchecked {
            ++totalSupply;
        }
        _mint(to, tokenId);

        emit ExternalIdMint(externalId);
    }

    function setBaseURI(string memory baseURI) external onlyOwner {
        _baseURI = baseURI;
    }
}
"
